function Navbar() {
	return (
		<div style={{ display: "flex", justifyContent: "space-between" }}>
			<div style={{display: ""}}>
				<p>Burger</p>
				<p>Movies</p>
				<p>Series</p>
			</div>
			<p>MoviesSearch</p>
			<div>
				<p>Search</p>
				<p>Profile</p>
			</div>
		</div>
	);
}

export default Navbar;
